import './App.css';
import { Button, Typography } from '@mui/material';

function App() {
  return (
    <div className="App">
      <div className='Header'>
        <Typography variant="h3" >MINI-PROJECT</Typography>
        <Button variant="text">Login</Button>
      </div>
    </div>
  );
}

export default App;
